import React from 'react';
import { geolocated } from 'react-geolocated';

// Latitude component
const Latitude = ({ isGeolocationAvailable, isGeolocationEnabled, coords }) => {
  if (!isGeolocationAvailable) {
    return <div>Geolocation is not available</div>;
  }

  if (!isGeolocationEnabled) {
    return <div>Geolocation is not enabled</div>;
  }

  return (
    <div>
      Latitude: {coords ? coords.latitude : 'Fetching latitude...'}
    </div>
  );
};

// Longitude component
const Longitude = ({ isGeolocationAvailable, isGeolocationEnabled, coords }) => {
  if (!isGeolocationAvailable) {
    return <div>Geolocation is not available</div>;
  }

  if (!isGeolocationEnabled) {
    return <div>Geolocation is not enabled</div>;
  }

  return (
    <div>
      Longitude: {coords ? coords.longitude : 'Fetching longitude...'}
    </div>
  );
};

// Wrap the components with geolocated HOC to access user's geolocation
const LatitudeWithGeolocation = geolocated({
  positionOptions: {
    enableHighAccuracy: false,
  },
  userDecisionTimeout: 5000,
})(Latitude);

const LongitudeWithGeolocation = geolocated({
  positionOptions: {
    enableHighAccuracy: false,
  },
  userDecisionTimeout: 5000,
})(Longitude);

// Main component
const GeolocationComponent = () => {
  return (
    <div>
      <LatitudeWithGeolocation />
      <LongitudeWithGeolocation />
    </div>
  );
};

export default GeolocationComponent;
